          width="220"
          height="413"/></a
      >&nbsp;
      <div>
        <div><br /></div>
      </div>
    </div>
    <div>
      <div style="width: 222px">
        <div>
          Melancholy youth representing the Earl of Essex, c.1588, miniature by
          <a
            href="https://en.wikipedia.org/wiki/Nicholas_Hilliard"
            title="Nicholas Hilliard"
            >Nicholas Hilliard</a
          ><sup
            ><a
              href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-7"
              >[7]</a
            ></sup
          >
        </div>
      </div>
    </div>
    <p>
      Devereux first came to court in 1584, and by 1587 had become a favourite
      of the Queen, who relished his lively mind and eloquence, as well as his
      skills as a showman and in courtly love. In June 1587 he replaced the Earl
      of Leicester as
      <a
        href="https://en.wikipedia.org/wiki/Master_of_the_Horse"
        title="Master of the Horse"
        >Master of the Horse</a
      >.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-8"
          >[8]</a
        ></sup
      >
      After Leicester&apos;s death in 1588, the Queen transferred the late
      Earl&apos;s royal monopoly on sweet wines to Essex, providing him with
      revenue from taxes. In 1593, he was made a member of her
      <a
        href="https://en.wikipedia.org/wiki/Privy_Council_of_England"
        title="Privy Council of England"
        >Privy Council</a
      >.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-compeerage-9"
          >[9]</a
        ></sup
      >
    </p>
    <p>
      Essex underestimated the Queen, however, and his later behaviour towards
      her lacked due respect and showed disdain for the influence of her
      principal secretary,
      <a
        href="https://en.wikipedia.org/wiki/Robert_Cecil,_1st_Earl_of_Salisbury"
        title="Robert Cecil, 1st Earl of Salisbury"
        >Robert Cecil</a
      >. On one occasion during a heated Privy Council debate on the problems in
      Ireland, the Queen reportedly cuffed an insolent Essex round the ear,
      prompting him to half draw his sword on her.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-10"
          >[10]</a
        ></sup
      >
    </p>
    <p>
      In 1589, he took part in
      <a
        href="https://en.wikipedia.org/wiki/Francis_Drake"
        title="Francis Drake"
        >Francis Drake</a
      >&apos;s
      <a
        href="https://en.wikipedia.org/wiki/English_Armada"
        title="English Armada"
        >English Armada</a
      >, which sailed to Spain in an unsuccessful attempt to press home the
      English advantage following the defeat of the
      <a
        href="https://en.wikipedia.org/wiki/Spanish_Armada"
        title="Spanish Armada"
        >Spanish Armada</a
      >, although the Queen had ordered him not to take part. In 1591, he was
      given command of a force sent to the assistance of King
      <a
        href="https://en.wikipedia.org/wiki/Henry_IV_of_France"
        title="Henry IV of France"
        >Henry IV of France</a
      >. In 1596, he distinguished himself by the
      <a
        href="https://en.wikipedia.org/wiki/Capture_of_C%C3%A1diz"
        title="Capture of Cádiz"
        >capture of C&aacute;diz</a
      >.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-bbc-2"
          >[2]</a
        ></sup
      >
      During the
      <a
        href="https://en.wikipedia.org/wiki/Islands_Voyage"
        title="Islands Voyage"
        >Islands Voyage</a
      >
      expedition to the
      <a href="https://en.wikipedia.org/wiki/Azores" title="Azores">Azores</a>
      in 1597, with
      <a
        href="https://en.wikipedia.org/wiki/Walter_Raleigh"
        title="Walter Raleigh"
        >Walter Raleigh</a
      >
      as his second-in-command, he defied the Queen&apos;s orders, pursuing the
      Spanish treasure fleet without first defeating the Spanish battle fleet.
    </p>
    <p>
      When the
      <a
        href="https://en.wikipedia.org/wiki/3rd_Spanish_Armada"
        title="3rd Spanish Armada"
        >3rd Spanish Armada</a
      >
      first appeared off the English coast in October 1597, the English fleet
      was far out to sea, with the coast almost undefended, and panic ensued.
      This further damaged the relationship between the Queen and Essex, even
      though he was initially given full command of the English fleet when he
      reached England a few days later. Fortunately a storm dispersed the
      Spanish fleet. A number of ships were captured by the English and though
      there were a few landings, the Spanish withdrew.&nbsp;
    </p>
    <h2><span>Ireland</span></h2>
