    <p>
      Essex&apos;s greatest failure was as
      <a
        href="https://en.wikipedia.org/wiki/Lord_Lieutenant_of_Ireland"
        title="Lord Lieutenant of Ireland"
        >Lord Lieutenant of Ireland</a
      >, a post which he talked himself into in 1599.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-bbc-2"
          >[2]</a
        ></sup
      >
      The
      <a
        href="https://en.wikipedia.org/wiki/Nine_Years%27_War_(Ireland)"
        title="Nine Years' War (Ireland)"
        >Nine Years&apos; War</a
      >
      (1595&ndash;1603) was in its middle stages, and no English commander had
      been successful. More military force was required to defeat the Irish
      chieftains, led by
      <a
        href="https://en.wikipedia.org/wiki/Hugh_O%27Neill,_3rd_Earl_of_Tyrone"
        title="Hugh O'Neill, 3rd Earl of Tyrone"
        >Hugh O&apos;Neill, the Earl of Tyrone</a
      >, and supplied from Spain and Scotland.
    </p>
    <p>
      Essex led the largest expeditionary force ever sent to
      Ireland&mdash;16,000 troops&mdash;with orders to put an end to the
      rebellion. He departed London to the cheers of the Queen&apos;s subjects,
      and it was expected the rebellion would be crushed instantly, but the
      limits of Crown resources and of the Irish campaigning season dictated
      otherwise.
    </p>
    <p>
      Essex had declared to the
      <a
        href="https://en.wikipedia.org/wiki/Privy_Council_of_the_United_Kingdom"
        title="Privy Council of the United Kingdom"
        >Privy Council</a
      >
      that he would confront O&apos;Neill in
      <a href="https://en.wikipedia.org/wiki/Ulster" title="Ulster">Ulster</a>.
      Instead, he led his army into southern Ireland, where he fought a series
      of inconclusive engagements, wasted his funds, and dispersed his army into
      garrisons, while the Irish won two important battles in other parts of the
      country. Rather than face O&apos;Neill in battle, Essex entered a truce
      that some considered humiliating to the Crown and to the detriment of
      English authority. The Queen herself told Essex that if she had wished to
      abandon Ireland it would scarcely have been necessary to send him there.
    </p>
    <p>
      In all of his campaigns Essex secured the loyalty of his officers by
      conferring knighthoods, an honour the Queen herself dispensed sparingly,
      and by the end of his time in Ireland more than half the knights in
      England owed their rank to him.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-11"
          >[11]</a
        ></sup
      >
      The rebels were said to have joked that, &quot;he never drew sword but to
      make knights.&quot; But his practice of conferring knighthoods could in
      time enable Essex to challenge the powerful factions at Cecil&apos;s
      command.
    </p>
    <p>
      He was the second Chancellor of
      <a
        href="https://en.wikipedia.org/wiki/University_of_Dublin"
        title="University of Dublin"
        >Trinity College, Dublin</a
      >, serving from 1598 to 1601.&nbsp;
    </p>
    <h2><span>Essex rebellion</span></h2>
    <div class="hatnote navigation-not-searchable">
      Main article:
      <a
        href="https://en.wikipedia.org/wiki/Essex%27s_Rebellion"
        title="Essex's Rebellion"
        >Essex&apos;s Rebellion</a
      >
    </div>
    <p>
      In August, his freedom was granted, but the source of his basic
      income&mdash;the sweet wines monopoly&mdash;was not renewed. His situation
      had become desperate, and he shifted &quot;from sorrow and repentance to
      rage and rebellion.&quot; In early 1601, he began to fortify
      <a
        href="https://en.wikipedia.org/wiki/Essex_House_(London)"
        title="Essex House (London)"
        >Essex House</a
      >, his town mansion on the
      <a
        href="https://en.wikipedia.org/wiki/Strand,_London"
        title="Strand, London"
        >Strand</a
      >, and gathered his followers. On the morning of 8 February, he marched
      out of Essex House with a party of nobles and gentlemen (some later
      involved in the 1605
      <a
        href="https://en.wikipedia.org/wiki/Gunpowder_Plot"
        title="Gunpowder Plot"
        >Gunpowder Plot</a
      >) and entered the city of London in an attempt to force an audience with
      the Queen. Cecil immediately had him proclaimed a traitor. A force under
      <a href="https://en.wikipedia.org/wiki/John_Leveson" title="John Leveson"
        >Sir John Leveson</a
      >
      placed a barrier across the street at
      <a href="https://en.wikipedia.org/wiki/Ludgate_Hill" title="Ludgate Hill"
        >Ludgate Hill</a
      >. When Essex&apos;s men tried to force their way through, Essex&apos;s
      stepfather,
      <a
        href="https://en.wikipedia.org/wiki/Christopher_Blount"
        title="Christopher Blount"
        >Sir Christopher Blount</a
      >, was injured in the resulting skirmish, and Essex withdrew with his men
      to Essex House.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-14"
          >[14]</a
        ></sup
      >
      Essex surrendered after Crown forces besieged Essex House.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-15"
          >[15]</a
        ></sup
      >
    </p>
