    <p>
      On 19 February 1601, Essex was tried before his peers on charges of
      treason.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-16"
          >[16]</a
        ></sup
      >
      Quoting from <em>State Trials</em> (compiled by T. B. Howell and T. J.
      Howell, 33 vols., London, 1809&ndash;26, vol. I, pp. 1334-1360), author
      Laura Hanes Cadwallader summarized the indictment:
    </p>
    <blockquote>
      <p>
        The indictment charged Essex with &quot;conspiring and imagining at
        London, . . . to depose and slay the Queen, and to subvert the
        Government.&quot; It also stated that Essex had &quot;endeavoured to
        raise himself to the Crown of England, and usurp the royal
        dignity,&quot; and that in order to fulfill these intentions, he and
        others &quot;rose and assembled themselves in open rebellion, and moved
        and persuaded many of the citizens of London to join them in their
        treason, and endeavored to get the city of London into their possession
        and power, and wounded and killed many of the Queen&apos;s subjects then
        and there assembled for the purpose of quelling such rebellion.&quot;
        Essex was charged also with holding the Lord Keeper and the other Privy
        Councillors in custody &quot;for four hours and more.&quot;<sup
          ><a
            href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-17"
            >[17]</a
          ></sup
        >
      </p>
    </blockquote>
    <p>
      Part of the evidence showed that he was in favour of toleration of
      religious dissent. In his own evidence, he countered the charge of dealing
      with
      <a
        href="https://en.wikipedia.org/wiki/Catholic_Church"
        title="Catholic Church"
        >Catholics</a
      >, swearing that &quot;papists have been hired and suborned to witness
      against me.&quot; Essex also asserted that Cecil had stated that none in
      the world but the
      <a href="https://en.wikipedia.org/wiki/Infanta" title="Infanta"
        >Infanta</a
      >
      of Spain had right to the Crown of England, whereupon Cecil (who had been
      following the trial at a doorway concealed behind some tapestry) stepped
      out to make a dramatic denial, going down on his knees to give thanks to
      God for the opportunity.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-18"
          >[18]</a
        ></sup
      >
      The witness whom Essex expected to confirm this allegation, his uncle
      William Knollys, was called and admitted there had once been read in
      Cecil&apos;s presence a book treating such matters. The book may have been
      either <em>The book of succession</em> supposedly by R. Doleman but
      probably by
      <a
        href="https://en.wikipedia.org/wiki/Robert_Persons"
        title="Robert Persons"
        >Robert Persons</a
      >
      or Persons&apos;
      <em
        ><a
          href="https://en.wikipedia.org/wiki/A_Conference_about_the_Next_Succession_to_the_Crown_of_England"
          title="A Conference about the Next Succession to the Crown of England"
          >A Conference about the Next Succession to the Crown of England</a
        ></em
      >, works which favoured a Catholic successor friendly to Spain.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-19"
          >[19]</a
        ></sup
      >
      However Knollys denied hearing Cecil make the statement. Thanking God
      again, Cecil expressed his gratitude that Essex was exposed as a
      <a href="https://en.wikipedia.org/wiki/Traitor" title="Traitor"
        >traitor</a
      >
      while he himself was found an honest man.
    </p>
    <p>
      Essex was found guilty and, on 25 February 1601, was beheaded on Tower
      Green, becoming the last person to be beheaded in the
      <a
        href="https://en.wikipedia.org/wiki/Tower_of_London"
        title="Tower of London"
        >Tower of London</a
      >. It was reported to have taken three strokes by the executioner
      <a
        href="https://en.wikipedia.org/wiki/Thomas_Derrick"
        title="Thomas Derrick"
        >Thomas Derrick</a
      >
      to complete the beheading. Previously Thomas Derrick had been convicted of
      rape but was pardoned by the Earl of Essex himself (clearing him of the
      death penalty) on the condition that he become an executioner at Tyburn.
      At Sir
      <a
        href="https://en.wikipedia.org/wiki/Walter_Raleigh"
        title="Walter Raleigh"
        >Walter Raleigh</a
      >&apos;s own execution on 29 October 1618, it was alleged that Raleigh had
      said to a co-conspirator, &quot;Do not, as my Lord Essex did, take heed of
      a preacher. By his persuasion, he confessed, and made himself
      guilty.&quot; In that same trial, Raleigh also denied that he had stood at
      a window during the execution of Essex&apos;s sentence, disdainfully
      puffing out tobacco smoke in sight of the condemned man. Essex at
      &nbsp;the end shocked many by denouncing his sister
      <a
        href="https://en.wikipedia.org/wiki/Penelope_Devereux"
        title="Penelope Devereux"
        >Penelope, Lady Rich</a
      >
      as his co-conspirator: the Queen, who was determined to show as much
      clemency as possible, ignored the charge.
    </p>
    <p>
      Some days before the execution, Captain
      <a
        href="https://en.wikipedia.org/wiki/Thomas_Lee_(army_captain)"
        title="Thomas Lee (army captain)"
        >Thomas Lee</a
      >
      was apprehended as he kept watch on the door to the Queen&apos;s chambers.
      His plan had been to confine her until she signed a warrant for the
      release of Essex. Capt. Lee, who had served in Ireland with the Earl, and
      who acted as a go-between with the Ulster rebels, was tried and put to
      death the next day.
    </p>
    <p>
      Essex&apos;s conviction for treason meant that the earldom was forfeit and
      his son did not inherit the title. However, after the Queen&apos;s death,
      King
      <a
        href="https://en.wikipedia.org/wiki/James_I_of_England"
        title="James I of England"
        >James I</a
      >
      reinstated the earldom in favour of the disinherited son,
      <a
        href="https://en.wikipedia.org/wiki/Robert_Devereux,_3rd_Earl_of_Essex"
        title="Robert Devereux, 3rd Earl of Essex"
        >Robert Devereux, 3rd Earl of Essex</a
      >.
    </p>
    <h3><span>The Essex ring</span></h3>
    <p>
      There is a widely repeated romantic legend about a ring given by Elizabeth
      to Essex. There is a possible reference to the legend by
      <a href="https://en.wikipedia.org/wiki/John_Webster" title="John Webster"
        >John Webster</a
      >
      in his 1623 play
      <em
        ><a
          href="https://en.wikipedia.org/wiki/The_Devil%27s_Law_Case"
          title="The Devil's Law Case"
          >The Devil&apos;s Law Case</a
        ></em
      >
      suggesting that it was known at this time, but the first printed version
      of it is in the 1695 romantic novel
      <em
        >The Secret History of the most renowned Queen Elizabeth and the Earl of
        Essex, by a Person of Quality</em
      >. The version is given by
      <a href="https://en.wikipedia.org/wiki/David_Hume" title="David Hume"
        >David Hume</a
      >
      in his
      <em
        ><a
          href="https://en.wikipedia.org/wiki/The_History_of_England_(Hume)"
          title="The History of England (Hume)"
          >History of England</a
        ></em
      >
      says that Elizabeth had given Essex a ring after the expedition to Cadiz
      that he should send to her if he was in trouble. After his trial, he tried
      to send the ring to Elizabeth via the
      <a
        href="https://en.wikipedia.org/wiki/Catherine_Howard,_Countess_of_Nottingham"
        title="Catherine Howard, Countess of Nottingham"
        >Countess of Nottingham</a
      >, but the countess kept the ring as her husband was an enemy of Essex, as
      a result of which Essex was executed. On her deathbed, the countess is
      said to have confessed this to Elizabeth, who angrily replied: &quot;May
      God forgive you, Madam, but I never can.&quot; The Queen&apos;s Diamond
      Jubilee Galleries in
      <a
        href="https://en.wikipedia.org/wiki/Westminster_Abbey"
        title="Westminster Abbey"
        >Westminster Abbey</a
      >
      possess a gold ring which is claimed to be this one.
    </p>
    <p>
      Some historians consider this story of the ring to be a myth, partly
      because there are no contemporaneous accounts of it.
      <a href="https://en.wikipedia.org/wiki/John_Lingard" title="John Lingard"
        >John Lingard</a
      >
      in his history of England says the story appears to be a fiction,
      <a
        href="https://en.wikipedia.org/wiki/Lytton_Strachey"
        title="Lytton Strachey"
        >Lytton Strachey</a
      >
      states &quot;Such a narrative is appropriate enough to the place where it
      was first fully elaborated &mdash; a sentimental novelette, but it does
      not belong to history&quot;, and
      <a href="https://en.wikipedia.org/wiki/Alison_Weir" title="Alison Weir"
        >Alison Weir</a
      >
      calls it a fabrication.<sup
        ><a
          href="https://en.wikipedia.org/wiki/Robert_Devereux,_2nd_Earl_of_Essex#cite_note-20"
          >[20]</a
        ></sup
      >
    </p>
    <p>
      Nevertheless, this version of the story forms the basis of the plot of
      <a
        href="https://en.wikipedia.org/wiki/Gaetano_Donizetti"
        title="Gaetano Donizetti"
        >Gaetano Donizetti</a
      >&apos;s opera
      <em
        ><a
          href="https://en.wikipedia.org/wiki/Roberto_Devereux"
          title="Roberto Devereux"
          >Roberto Devereux</a
        ></em
      >, with a further twist added to the story, in that Essex is cheating on
      both the Queen and his best friend by having an affair with Lady
      Nottingham (who in the opera is given the wrong first name of Sarah rather
      than Catherine): and that this turns out to be (a) the reason why Lord
      Nottingham turns against his now former friend, when he discovers the ring
      in question and prevents her sending it, and (b) is the ultimate reason
      for Queen Elizabeth withdrawing her support for Essex at his trial. The
      actual question of Devereux&apos;s genuine guilt or innocence is sidelined
      (as is his actual failed rebellion), and the trial is presented as
      effectively a Parliamentary witch-hunt led by Cecil and Raleigh.&nbsp;
    </p>
